    'content': React.createElement("article", { dangerouslySetInnerHTML: {
            __html: '<h1>请求 Requests</h1>\n<p>路由属性和函数签名一起指定请求必须为真的内容，才能调用路由的处理程序。你已经看到一个这样的例子：</p>\n<pre class="language-rust"><code class="language-rust"><span class="token attribute attr-name">#[get(<span class="token string">"/world"</span>)]</span>\n<span class="token keyword">fn</span> <span class="token function-definition function">handler</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span> <span class="token punctuation">..</span> <span class="token punctuation">}</span>\n</code></pre>\n<p>这个路由指定了它仅匹配到<code>/world</code>的<code>GET</code>请求。Rocket在调用处理器之前会验证这一点。当然，你可以做的不仅仅是指定请求的路径和方法。除了其它事情，Rocket还可以自动地进行数据验证：</p>\n<ul>\n<li>动态路径段的类型。</li>\n<li>路由动态参数的个数。</li>\n<li>请求体的数据类型。</li>\n<li>查询字符串，表单和表单值的类型。</li>\n<li>请求的预期传入或传出格式。</li>\n<li>任何用户定义的安全验证策略。</li>\n</ul>\n<p>路由属性和函数签名共同描述了这些验证规则。Rocket的代码生成器实际担任了验证这些数据的工作。这一节主要讲怎样使用Rocket来进行这些数据验证和其他验证。</p>\n<h2 id="请求方法-methods">请求方法 Methods<a class="anchor" href="Requests/Methods.html#请求方法-methods">§</a></h2>\n<p>Rocket route属性可以是<code>get</code>、<code>put</code>、<code>post</code>、<code>delete</code>、<code>head</code>、<code>patch</code>或<code>options</code>中的任意一个，每个属性都对应于要匹配的HTTP方法。例如，以下属性将与根路径的POST请求匹配：</p>\n<pre class="language-rust"><code class="language-rust"><span class="token attribute attr-name">#[post(<span class="token string">"/"</span>)]</span>\n</code></pre>\n<p>这些属性的语法在 <a href="https://api.rocket.rs/v0.4/rocket_codegen/attr.route.html"><code>rocket_codegen</code></a> API文档中正式定义。</p>\n<h3 id="head请求">HEAD请求<a class="anchor" href="Requests/Methods.html#head请求">§</a></h3>\n<p>当存在一个GET路由时，Rocket会自动处理对应路由的<code>HEAD</code>请求。如果能够匹配的上，Rocket将原来的响应体过滤掉，作为<code>HEAD</code>路由的响应。你也可以为<code>HEAD</code>请求单独声明一个路由； Rocket并不会干涉你程序中对<code>HEAD</code>请求的处理。</p>\n<h3 id="重解析">重解析<a class="anchor" href="Requests/Methods.html#重解析">§</a></h3>\n<p>因为浏览器只能发送<code>GET</code>和<code>POST</code>请求，Rocket在特定条件下会<em>重解析</em>请求的方法。如果<code>POST</code>请求的<code>header</code>里包含<code>Content-Type:application/x-www-form-urlencoded</code>，并且表单的第一个字段名为<code>_method</code>，值为HTTP请求的合法方法（例如<code>&quot;PUT&quot;</code>）,Rocket将会以这个值中的方法，作为这次请求的方法。这会使Rocket应用程序可以提交非<code>POST</code>的表单。<a href="https://github.com/SergioBenitez/Rocket/tree/v0.3.13/examples/todo/static/index.html.tera#L47">例子todo</a> 里面用了这个特性，通过网页表单提交<code>PUT</code>和<code>DELETE</code>请求。</p>'
        } }),
